import React from "react";
import { LogoutButton } from "../../buttons/logout-button";

export const SideBar = ({ children }) => {
  return (
    <div className="bg-blue-900 fixed top-0 left-0 rounded-r-3xl w-1/6">
      <nav className="flex flex-col justify-between min-h-screen">
        <div>
          <div className="bg-white m-3 rounded">
            <img
              className="mx-auto p-1"
              src="/logo-no-background.png"
              alt="Auth0 shield logo"
              width="175"
              height="40"
            />
          </div>
          <div className="bg-orange-300">{children}</div>
        </div>
        <div className="mx-auto mb-3 w-10/12">
          <LogoutButton />
        </div>
      </nav>
    </div>
  );
};
